$(function(){$(".docs-menu-box a").siblings("ul.submenu").each(function(index,domele){$(domele).siblings("a").append("<span class=\"custom-arrow custom-right-arrow\"></span>")});$(".docs-menu-box a").click(function(){var submenu=$(this).siblings("ul.submenu");if(submenu.length>0){var submenuShow=submenu.css("display");if(submenuShow==="block"){$(submenu).slideUp(600)}else{$(submenu).slideDown(600)}
    if(submenuShow==="block"){$(this).find(".custom-arrow").removeClass("custom-down-arrow");$(this).find(".custom-arrow").addClass("custom-right-arrow")}else{$(this).find(".custom-arrow").removeClass("custom-right-arrow");$(this).find(".custom-arrow").addClass("custom-down-arrow")}}});function bindClickDocsMenu(){$(".hidden-menu.docs-menu-btn-nav").off().on("click",function(e){$(".docs-left-menu").css({"flex":"0 0 220px","left":"unset"});$(this).css({"left":"220px"});$(this).removeClass("hidden-menu").addClass("show-menu");bindClickDocsMenu()});$(".show-menu.docs-menu-btn-nav").off().on("click",function(e){$(".docs-left-menu").css({"flex":"0 0 0px","left":"-220px"});$(this).css({"left":"0"});$(this).removeClass("show-menu").addClass("hidden-menu");bindClickDocsMenu()})}
    bindClickDocsMenu();$(document).on("mousewheel DOMMouseScroll",function(event){if((event.target.classList).includes("bind-scroll-to-content")){var targetDom=$(".docs-right-content");var scroll_top=targetDom.scrollTop();if(event.originalEvent.wheelDelta>0||event.originalEvent.detail<0){targetDom.scrollTop(scroll_top-100)}else{targetDom.scrollTop(scroll_top+100)}}})})
